SET NAMES UTF8;

DROP TABLE IF EXISTS level1;

CREATE TABLE level1 (
    id char(2) not null,
    name varchar(255),
    PRIMARY KEY (id)
) DEFAULT CHARSET=UTF8 Engine=InnoDB;

DROP TABLE IF EXISTS level2;

CREATE TABLE level2 (
    id char(4) not null,
    type int not null,
    level1_id char(2) not null,
    name varchar(255),
    PRIMARY KEY (id),
    KEY (level1_id)
) DEFAULT CHARSET=UTF8 Engine=InnoDB;

DROP TABLE IF EXISTS level3;

CREATE TABLE level3 (
    id char(10) not null,
    type int not null,
    level2_id char(4) not null,
    level2_type int not null,
    level1_id char(2) not null,
    name varchar(255),
    PRIMARY KEY (id),
    KEY (level2_id),
    KEY (level1_id)
) DEFAULT CHARSET=UTF8 Engine=InnoDB;

